import {createRouter, createWebHistory} from 'vue-router'
import EmulationTitleHome from '@/views/emulationtitle/EmulationTitleHome.vue'
import OverViewHome from '@/views/overview/OverViewHome.vue'


const routers=[
    {
        path:"/",component:OverViewHome,name:"OverViewHomeRouter"
    },
    {
        path:"/emulationtitle",comments:EmulationTitleHome,name:"EmulationTitleHomeRouter"
    },
    {
        path:"/overview",comments:OverViewHome,name:"OverViewHomeRouter"
    },
]

const router=createRouter({
    history:createWebHistory(),
    routes:routers
})

export default router;
